const PLANETS_URL = 'https://swapi-trybe.herokuapp.com/api/planets/';

export const getPlanets = () => (
  fetch({PLANETS_URL})
    .then((response) => (
      response
      .json()
      .then((json) => (resolve.ok ? Promise.resolve
        (json) : Promise.reject(json)))
    ))  
);
